using Shouldly;
using System;
using System.CodeDom;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using TravelApp.Destinations;
using TravelApp.EntityFrameworkCore;
using Volo.Abp.Account;
using Volo.Abp.Domain.Repositories;
using Volo.Abp.Modularity;
using Volo.Abp.Uow;
using Volo.Abp.Validation;
using Xunit;

namespace TravelApp.Destination
{
    public abstract class IDestinationAppService<TStartupModule> : TravelAppApplicationTestBase<TStartupModule>
        where TStartupModule : IAbpModule
    {
        private readonly IDestinationAppService _service;
        private readonly Volo.Abp.EntityFrameworkCore.IDbContextProvider<TravelAppDbContext> _dbContextProvider;
        private readonly IUnitOfWorkManager _unitOfWorkManager;
        protected IDestinationAppService()
        {
            _service = GetRequiredService<IDestinationAppService>();
            _dbContextProvider = GetRequiredService<Volo.Abp.EntityFrameworkCore.IDbContextProvider<TravelAppDbContext>>();
            _unitOfWorkManager = GetRequiredService<IUnitOfWorkManager>();
        }
        [Fact]
        public async Task CreateAsync_Should_Return_Created_Destination_Dto()
        {
            //Arrange part creates an Issue entity and ensures the CloseDate is null at the beginning.
            var input = new CreateUpdateDestinationDto
            {
                Name = "Paris",
                Id = Guid.NewGuid(),
                ImageURL = "data:image/jpeg;base64,",
                Latitude = "48.8588897",
                Longitude = "48.8588897"
            };
            //Act part executes the method we want to test for this case.
            var result = await _service.CreateAsync(input);
            //Assert part checks if the Issue properties are same as we expect to be.
            result.ShouldNotBeNull();
            result.Id.ShouldNotBe(Guid.Empty);
            result.ImageURL.ShouldBe(input.ImageURL);
            result.Name.ShouldBe(input.Name);
        }
        [Fact]
        public async Task CreateAsync_Should_Persist_Destination_In_Database()
        {
            using (var uow = _unitOfWorkManager.Begin())
            {
                //Arrange part creates an Issue entity and ensures the CloseDate is null at the beginning.
                var input = new CreateUpdateDestinationDto
                {
                    Name = "Paris",
                    Id = Guid.NewGuid(),
                    ImageURL = "data:image/jpeg;base64,",
                    Latitude = "48.8588897",
                    Longitude = "48.8588897"
                };
                //Act part executes the method we want to test for this case.
                var result = await _service.CreateAsync(input);
                //Assert part checks if the Issue properties are same as we expect to be.
                var dbContext = await _dbContextProvider.GetDbContextAsync();
                var destination = await dbContext.Destinations.FindAsync(result.Id);
                destination.ShouldNotBeNull();
                destination.Name.ShouldBe(input.Name);
                destination.Latitude.ShouldBe(input.Latitude);
                destination.Longitude.ShouldBe(input.Longitude);
            }
        }
        [Fact]
        public async Task CreateAsync_Should_Throw_Exception_If_Destination_Already_Exists()
        {
//Arrange part prepares everything we need for the test.
            var input = new CreateUpdateDestinationDto
            {
                Name = "Paris",
                Id = Guid.NewGuid(),
                ImageURL = "data:image/jpeg;base64,",
                Latitude = "48.8588897",
                Longitude = "48.8588897"
            };
            await _service.CreateAsync(input);

            var exception = await Should.ThrowAsync<AbpValidationException>(async () =>
            {
                await _service.CreateAsync(input);
            });
        }
    }
}
